func NewVertex(userConfig map[string]interface{}) *Vertex {
	p := &vertex{}
	p.Init(userConfig)
	return &Vertex{
		vertex:        p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}

